    "\u7231\u4f60\u5b9e\u5728\u662f\u4e00\u4ef6\u6ee1\u5fc3\u6b22\u559c\u7684\u4e8b\u60c5",
    "\u4f60\u7684\u773c\u50cf\u84dd\u8272\u591a\u7459\u6cb3\u7684\u6c34\uff0c\u4f60\u7684\u5507\u50cf\u4e09\u6708\u5bcc\u58eb\u5c71\u7684\u6a31\u82b1",
    "\u5e0c\u671b\u5979\u597d\uff0c\u5e0c\u671b\u5979\u987a\u5229\uff0c\u5373\u4f7f\u5c0f\u6709\u574e\u5777\uff0c\u5076\u9047\u56f0\u987f\uff0c\u4e5f\u7ec8\u80fd\u5316\u9669\u4e3a\u5937",
    "\u5e0c\u671b\u4f60\u672a\u6765\u7684\u8def\uff0c\u591a\u4e00\u70b9\u606d\u559c\u901a\u5173",
    "\u4f60\u70b9\u4e86\u706b\u5417",
    "\u770b\u5230\u6709\u4e91\u5f00\u59cb\u5760\u843d\uff0c\u5316\u6210\u6ee1\u5c71\u91ce\u7684\u5fc3\u8df3\u548c\u7099\u70ed",
    "\u5728\u8fd9\u4e2a\u4e16\u754c\u4e0a\u6211\u6709\u592a\u591a\u592a\u591a\u7684\u7231\u548c\u7f8e\u597d\u60f3\u8981\u7ed9\u4f60",
    "\u613f\u4f60\u7ecf\u5386\u4e16\u4e8b\u800c\u4e0d\u5931\u5973\u5b69\u610f\u8da3\uff0c\u4fdd\u6301\u575a\u5b9a\u4e0e\u70ed\u7231\uff0c\u4f9d\u7136\u80fd\u591f\u4e3a\u4e16\u95f4\u90a3\u4e9b\u771f\u5fc3\u5b9e\u610f\u800c\u5fc3\u52a8",
    "\u4eba\u5927\u6982\u662f\u56e0\u4e3a\u90a3\u4e00\u70b9\u70b9\u4e0d\u540c\u4e8e\u522b\u4eba\u7684\u575a\u6301\u624d\u66f4\u7279\u522b\u7684",
    "\u50cf\u6e05\u6668\u7684\u67e0\u6aac\u6c34",
    "\u50cf\u51ac\u65e5\u7684\u592a\u9633",
    "\u50cf\u68a6\u91cc\u7684\u5927\u6d77",
    "\u50cf\u7b2c\u4e00\u6b21\u9047\u89c1\u4f60",
    "\u4e3a\u4ec0\u4e48\u65f6\u5149\u53eb\u505a\u65f6\u5149\u5462",
    "\u5927\u6982\u662f\u56e0\u4e3a\u6bcf\u4e00\u6bb5\u65f6\u95f4\u91cc\uff0c\u90fd\u4f1a\u6709\u4e00\u4efd\u5149",
    "\u60f3\u8d77\u51ac\u96ea\u88ab\u9633\u5149\u6d47\u5316\uff0c\u4fe1\u7bb1\u91cc\u751c\u5f97\u6dcc\u871c\u7684\u60c5\u8bd7",
    "\u60f3\u8d77\u6240\u6709\u7f8e\u597d\u7684\u4e8b\uff0c\u60f3\u8d77\u597d\u5403\u7684\uff0c\u60f3\u8d77\u6e29\u67d4\uff0c\u60f3\u8d77\u4f60",
    "\u60f3\u8d81\u7740\u6708\u591c\u6726\u80e7\uff0c\u52ab\u6301\u4e00\u53ea\u9ed1\u8272\u7684\u4e91\uff0c\u53bb\u89c1\u4f60",
    "\u751f\u800c\u4e3a\u4eba\uff0c\u8bf7\u53ca\u65f6\u53ef\u7231",
    "\u5e0c\u671b\u4f60\u7684\u751f\u6d3b\u6e29\u67d4\u6709\u8da3\uff0c\u4e0d\u5fc5\u592a\u6fc0\u70c8\uff0c\u4e09\u9910\u56db\u5b63\uff0c\u4e0d\u5fc5\u592a\u5306\u5fd9",
    "\u4f60\u7b11\u65f6\uff0c\u96f7\u58f0\u6e29\u67d4\uff0c\u66b4\u96e8\u65e0\u58f0",
    "\u4f60\u662f\u672c\u6765\u6ca1\u6709\u628a\u63e1\u5374\u62ff\u4e86\u6ee1\u5206\u7684\u9898",
    "\u662f\u70ed\u7ea2\u8336\u4e0a\u98d8\u7740\u7684\u5976\u6cb9\u51b0\u6dc7\u6dcb",
    "\u662f\u5bd2\u98ce\u51db\u51bd\u4f9d\u65e7\u5728\u7a97\u6a90\u4e0b\u53ee\u53ee\u549a\u549a\u7684\u98ce\u94c3",
    "\u4f60\u662f\u8fd9\u4e2a\u51ac\u65e5\u7684\u5929\u6674",
    "\u4f60\u662f \u65e0\u529b\u6297\u62d2\u4e0d\u505c\u8ffd\u9010\u7684\u78c1\u573a",
    "\u4f60\u662f \u508d\u665a\u843d\u65e5\u4f59\u6656\u7684\u65b9\u5411",
    "\u4f60\u662f \u4e0d\u613f\u505c\u4e0b\u7684\u96be\u5fd8\u60c5\u957f",
    "\u4f60\u662f \u98de\u8d8a\u5c71\u5ddd\u6cb3\u6d41\u7684\u5927\u68a6\u4e00\u573a",
    "\u4f60\u662f \u6574\u591c\u767d\u96ea\u832b\u832b\u7684\u8def\u65c1",
    "\u4f60\u662f \u5357\u534a\u7403\u7684\u5e74\u5c11\u98ce\u5149",
    "\u6211\u60f3\u548c\u4f60\u865a\u5ea6\u65f6\u5149\uff0c\u6bd4\u5982\u4f4e\u5934\u770b\u9c7c",
